var fs = require('fs');
var util = require('util');
var log_file = fs.createWriteStream(__dirname + '/debug.log', {flags : 'w'});
var log_stdout = process.stdout;

console.log = function(d) { //
  log_file.write(util.format(d) + '\n');
  log_stdout.write(util.format(d) + '\n');
};

const makeTriumphs = () => {
  const firebaseTriumphObject = {};
  fullTriumphs.forEach((triumph, $index) => {
    const ftoKey = `triumph${$index}`;
    const triumphObject = {
      destinyTriumphId: triumph.hash,
      description: triumph.displayProperties.description,
      name: triumph.displayProperties.name,
      icon: `https://bungie.net${triumph.displayProperties.icon}`,
      scope:  triumph.scope
    };
    firebaseTriumphObject[ftoKey] = triumphObject;
  })

  console.log(firebaseTriumphObject)
};

makeTriumphs();